import react, { Fragment } from "react";
import classes from "./Header.module.css";
import Cart from "../Cart/Cart";

const Header = () => {
  return (
    <Fragment>
      <header className={classes.header}>
        <h1>ReactMeals</h1>
        <Cart />
      </header>
    </Fragment>
  );
};

export default Header;
